Yo hablaba para cualquier codigo ya existente.

Mi idea era hacer como hace vd. con el MVC. Un fichero .ch que incluya los plugins:
///////////////////////////////
// <http://base_mvc_plug.ch|base_mvc_plug.ch>
//
// Plugins habituales
//////////////////////////////////////////////////////////

{% loadhrb("orm.hrb" ) %}
{% loadhrb("wdo.hrb")  %}


En vez de meterlo todo en un .hrb. Quizá pueda ser un pelin mas rapido todo en un .hrb, pero es menos modular.

Sólo es una idea, mi capitán.

Yo lo haria asi. Ahí voy:

<http://BaseFiles.Ch|BaseFiles.Ch>

